import React, { useState, useEffect } from 'react';
import { ethers } from 'ethers';
import './App.css';

// Import your contract ABI and address
import VotingSystemData from './contracts/MultiSessionVotingSystem.json';

// Components
import OwnerPortal from './components/OwnerPortal';
import VoterPortal from './components/VoterPortal';
import Login from './components/Login';

function App() {
  const [provider, setProvider] = useState(null);
  const [signer, setSigner] = useState(null);
  const [contract, setContract] = useState(null);
  const [account, setAccount] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [userRole, setUserRole] = useState(''); // 'owner' or 'voter' or ''
  const [isConnected, setIsConnected] = useState(false);

  useEffect(() => {
    checkConnection();
  }, []);

  const checkConnection = async () => {
    try {
      if (typeof window.ethereum !== 'undefined') {
        const provider = new ethers.BrowserProvider(window.ethereum);
        const accounts = await provider.listAccounts();

        if (accounts.length > 0) {
          await connectWallet();
        }
      }
    } catch (error) {
      console.error('Error checking connection:', error);
    } finally {
      setLoading(false);
    }
  };

  const connectWallet = async () => {
    try {
      setLoading(true);
      setError('');

      if (typeof window.ethereum === 'undefined') {
        setError('Please install MetaMask to use this application');
        return;
      }

      // Request account access
      await window.ethereum.request({ method: 'eth_requestAccounts' });

      const provider = new ethers.BrowserProvider(window.ethereum);
      const signer = await provider.getSigner();
      const address = await signer.getAddress();

      // Check network
      const network = await provider.getNetwork();
      if (network.chainId !== 1337n) {
        setError('Please connect to Ganache network (Chain ID: 1337)');
        return;
      }

      setProvider(provider);
      setSigner(signer);
      setAccount(address);
      setIsConnected(true);

      // Initialize contract
      const votingContract = new ethers.Contract(
        VotingSystemData.address,
        VotingSystemData.abi,
        signer
      );

      setContract(votingContract);

      // Determine user role
      const owner = await votingContract.owner();
      const role = address.toLowerCase() === owner.toLowerCase() ? 'owner' : 'voter';
      setUserRole(role);

      // Setup event listeners
      setupEventListeners(votingContract);

    } catch (error) {
      console.error('Connection error:', error);
      setError(`Error connecting: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  const setupEventListeners = (contractInstance) => {
    // Listen for account changes
    window.ethereum.on('accountsChanged', (accounts) => {
      if (accounts.length === 0) {
        disconnectWallet();
      } else {
        connectWallet();
      }
    });

    // Listen for network changes
    window.ethereum.on('chainChanged', (chainId) => {
      if (chainId !== '0x539') { // 1337 in hex
        setError('Please connect to Ganache network (Chain ID: 1337)');
      } else {
        setError('');
      }
    });
  };

  const disconnectWallet = () => {
    setProvider(null);
    setSigner(null);
    setContract(null);
    setAccount('');
    setUserRole('');
    setIsConnected(false);
    setError('');
  };

  if (loading) {
    return (
      <div className="app">
        <div className="loading-container">
          <div className="loading-spinner"></div>
          <h2>Loading Voting System...</h2>
          <p>Connecting to blockchain...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="app">
        <div className="error-container">
          <h2>‚ö†Ô∏è Connection Error</h2>
          <p>{error}</p>
          <button onClick={connectWallet} className="btn btn-primary">
            üîÑ Try Again
          </button>
        </div>
      </div>
    );
  }

  if (!isConnected || !userRole) {
    return (
      <div className="app">
        <Login onConnect={connectWallet} />
      </div>
    );
  }

  return (
    <div className="app">
      {userRole === 'owner' ? (
        <OwnerPortal 
          contract={contract}
          account={account}
          onDisconnect={disconnectWallet}
        />
      ) : (
        <VoterPortal 
          contract={contract}
          account={account}
          onDisconnect={disconnectWallet}
        />
      )}
    </div>
  );
}

export default App;
